shared_text:
The dA Center for the Arts
May 11 at 5:52 PM ·

@fremontasb and @parkwestpusd Visual Art Teacher Scott Webber helps students rise to their full potential ! He ignites their fire to learn, create, and imagine! His positive energy gives his students confidence. He is thoughtful, dynamic, caring, empathetic, humorous, and passionate about giving equitable and accessible art opportunities to all of his students on both campuses. Thank you Scott for encouraging and empowering and inviting your students to think in creative ways! You are a gift to our community and we appreciate you! #teachersofinstagram #teachersofinstagram #pusd #dapomona #pomonavibes

